import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card'


ReactDOM.render(
    <>
    <h1> Welcome to a demonstation of a React App</h1>
    <div className="card_container">
        <Card 
        isc="https://source.unsplash.com/200x150/?nature"
        titel="Enjoy!"
        txt="Contrary to popular belief, Lorem Ipsum is not sirem Ipsum passag"
        />
    </div>
    </>,
    document.getElementById('root')
);
